/**
 * enum for TrackType
 */
export enum TrackType {
    /**
     * Index track
     */
    IndexTrack = 'IndexTrack',
    /**
     * Linear Track
     */
    LinearTrack = 'LinearTrack',
    /**
     * Logarithmic  Track
     */
    LogTrack = 'LogTrack',
    /**
     * Tangential Track
     */
    TangentialTrack = 'TangentialTrack',
    /**
     * Annotation Track
     */
    AnnotationTrack = 'AnnotationTrack',
    /**
     * Stacked Track
     */
    StackedTrack = 'StackedTrack'
}
